import numpy as np
from ncon import ncon
import time

A = np.random.rand(2, 2, 2)
B = np.random.rand(2, 2, 2, 2)
C = np.random.rand(2, 2, 2, 2)
E = np.random.rand(2, 2, 2)
D = np.random.rand(2, 2, 2)

"""![image.png](data:image/png;base64,)

##Способ №1: For
"""

start = time.time()
result_for = np.zeros((2, 2, 2))
for i in range(2):
  for j in range(2):
    for k in range(2):
      for m in range(2):
        for l in range(2):
          for n in range(2):
            for f in range(2):
              for g in range(2):
                for s in range(2):
                  for q in range(2):
                    result_for[i, j, k] += A[m, l, i] * B[m, f, n, j] * C[l, n, g, q] * E[s, f ,g] * D[s, q, k]
time_for = time.time() - start 
print("Валентность(правильный ответ - 3): ", result_for.shape)
print("Результирующий тензор:\n", result_for)

"""##Спобос №3: ncon"""

start = time.time()
result_ncon = ncon(
    (A, B, C, D, E), [[1, 4, -1], [1, 3, 5, -2], [4, 5, 6, 7], [2, 7, -3], [2, 3, 6]])

time_ncon = time.time()-start
print("Валентность(правильный ответ - 3): ", result_ncon.shape)
print("Результирующий тензор:\n", result_ncon)

"""##Спобос №2: @, reshape

![image.png](data:image/png;base64,)

![image.png](data:image/png;base64,)

![image.png](data:image/png;base64,)
"""

start = time.time()
Pos = [0, 0, 0]

r_A = np.reshape(A, (2, 4))
r_B = np.reshape(B, (2, 8))

if(Pos[0] == 0):
  AB = np.reshape(r_A.T@r_B, (2, 2, 2, 2, 2))#
else: 
  AB = np.reshape(r_B.T@r_A, (2, 2, 2, 2, 2))#

r_D = np.reshape(D, (2, 4))
r_E = np.reshape(E, (2, 4))

if(Pos[1] == 0):
  DE = np.reshape(r_D.T@r_E, (2, 2, 2, 2))#
else:
  DE = np.reshape(r_E.T@r_D, (2, 2, 2, 2))#

r_AB = np.reshape(AB, (2, 16))
r_DE = np.reshape(DE, (2, 8))


if(Pos[2] == 0):
  ABDE = np.reshape(r_AB.T@r_DE, (2, 2, 2, 2, 2, 2, 2))#
else:
  ABDE = np.reshape(r_DE.T@r_AB, (2, 2, 2, 2, 2, 2, 2))#

r_ABDE = np.reshape(ABDE, (2, 2, 2 ,16))
r_ABDE = np.reshape(r_ABDE, (8 ,16))
r_C = np.reshape(C, (16, ))
result_reshape = np.reshape(r_ABDE@r_C, (2, 2, 2))
time_reshape =  time.time() - start

print("Валентность(правильный ответ - 3): ", result_reshape.shape)
print("Результирующий тензор:\n", result_reshape)

"""##Время выполенния работы"""

print("Время выполнения работы с for = ", time_for)
print("Время выполнения работы с reshape = ", time_reshape)
print("Время выполнения работы с ncon = ", time_ncon)